import React from "react";

export default function Section1({
  title,
  subtitle,
  dark,
  id,
  img_src,
  pic1,
  pic2,
  pic3,
  pic4,
}) {
  return (
    <div className={"section1" + (dark ? " section1-dark" : "")}>
      <div className="section1-content" id={id}>
        <h1>{title}</h1>
        <img src={img_src} width="460"></img>
        <p className={"section1-text"}>{subtitle}</p>
        <img className="icon" src={pic1} width="50px"></img>
        <img className="icon" src={pic1} width="50px"></img>
        <img className="icon" src={pic1} width="50px"></img>
        <img className="icon" src={pic1} width="50px"></img>
      </div>
    </div>
  );
}
